import React from 'react';
import './AnamneseImpressao.css'; // Vamos criar este CSS a seguir

// Usamos React.forwardRef para que o componente possa receber a ref do react-to-print
const AnamneseImpressao = React.forwardRef(({ paciente, anamnese }, ref) => {
    if (!anamnese || !paciente) {
        return <div ref={ref}>Carregando dados para impressão...</div>;
    }

    const formatDate = (dateString) => {
        if (!dateString) return "-";
        const [year, month, day] = dateString.split('-');
        return `${day}/${month}/${year}`;
    };

    // Função auxiliar para exibir Sim/Não e a descrição
    const renderBooleanField = (label, value, description) => {
        return (
            <p>
                <strong>{label}:</strong> {value ? 'Sim' : 'Não'}
                {value && description && ` (${description})`}
            </p>
        );
    };

    return (
        // A ref é passada para a div principal que será impressa
        <div ref={ref} className="anamnese-print-container">
            <h2>Ficha de Anamnese</h2>
            
            <div className="section">
                <h3>Dados do Paciente</h3>
                <p><strong>Nome:</strong> {paciente.nome}</p>
                <p><strong>CPF:</strong> {paciente.cpf}</p>
                <p><strong>Data de Nascimento:</strong> {formatDate(paciente.data_nasc)}</p>
            </div>

            <div className="section">
                <h3>Informações da Anamnese</h3>
                <p><strong>Data da Anamnese:</strong> {formatDate(anamnese.data_anamnese)}</p>
                <p><strong>Motivo da Consulta:</strong> {anamnese.motivo_consulta || '-'}</p>
                <p><strong>Último Tratamento Odontológico:</strong> {anamnese.ultimo_trat || '-'}</p>
                <p><strong>Descrição Adicional:</strong> {anamnese.descricao || '-'}</p>
            </div>

            <div className="section">
                <h3>Questionário</h3>
                {renderBooleanField('Em tratamento médico?', anamnese.trat_medico, anamnese.trat_med_desc)}
                {renderBooleanField('Faz uso de medicamento?', anamnese.medicamento, anamnese.medicamento_desc)}
                {renderBooleanField('Teve reação à anestesia?', anamnese.reacao_anestesia, anamnese.reacao_anest_desc)}
                {renderBooleanField('Tem sensibilidade nos dentes?', anamnese.sensi_dentes, anamnese.sensi_dentes_desc)}
                {renderBooleanField('Range os dentes/apertamento?', anamnese.range_apertamento, anamnese.range_apert_desc)}
                {renderBooleanField('Gengiva sangra facilmente?', anamnese.gengiva_sangra, anamnese.gengiva_sang_desc)}
                {/* Ajuste para o campo 'fuma' */}
                <p>
                    <strong>Fumante?</strong> {anamnese.fuma ? 'Sim' : 'Não'}
                    {anamnese.fuma && (anamnese.fuma_desc !== null && anamnese.fuma_desc !== undefined) && ` (Detalhes: ${anamnese.fuma_desc})`}
                </p>
                {renderBooleanField('Diabético?', anamnese.diabetico, anamnese.diabetico_desc)}
                {renderBooleanField('Quando se corta, sangra muito?', anamnese.corte_sangra, anamnese.corte_sang_desc)}
                {renderBooleanField('Tem problema cardíaco?', anamnese.prob_cardiaco, anamnese.prob_card_desc)}
                {renderBooleanField('Dores de cabeça?', anamnese.dores_cabeca, anamnese.dores_cabeca_desc)}
                {renderBooleanField('Já teve desmaios ou ataques?', anamnese.desmaio_ataques, anamnese.desmaio_atq_desc)}
                {renderBooleanField('Tem pressão arterial alterada?', anamnese.pressao_art, anamnese.pressao_art_desc)}
            </div>
        </div>
    );
});

export default AnamneseImpressao;
